import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";

const Note = () => {
  return (
    <>
      <div className="note">
        <h1>Title</h1>
        <br />
        <p>This is content</p>
        <DeleteIcon className="deleteIcon" />
      </div>
    </>
  );
};

export default Note;
